import base64

data = ""

# 方法1：直接解码字符串
try:
    sdp = base64.b64decode(data)
    print(sdp)
    # sdp 是 bytes 类型
except Exception as err:
    # 处理错误
    print(f"解码错误: {err}")

# 方法2：如果 data 是字符串，确保编码正确
try:
    # base64.b64decode 可以接受字符串或 bytes
    sdp = base64.b64decode(data.encode('utf-8') if isinstance(data, str) else data)
    print(sdp)
except Exception as err:
    print(f"解码错误: {err}")
